import React from "react";
import "./Searchbar.css";

function Searchbar() {
  return (
    <div>
      <label for={uniqueId}>
        <img src="/images/Searchbar/Searchbar.svg" alt="Search icon" />
      </label>
      <input
        className="input-search"
        tabIndex={1}
        type="search"
        placeholder="Search Contacts"
      />
    </div>
  );
}

export default Searchbar;
